import React from "react";

const DropdownMenu = () => {
  return (
    <div className="dropdown-menu">
      <ul>
        <li><h4>Download From</h4></li>
        <li><img src="../assets/"/></li>
        <li>Menu 3</li>
      </ul>
    </div>
  );
};

export default DropdownMenu;
